import { MantineProvider, Box, Card, TextInput, Button } from "@mantine/core";
import axios from "axios";

function Home() {
  const usuario = {
    usuario: "ss",
    senha: "dd",
  };

  const autenticar = () => {
    axios.post(`http://localhost:8080/usuario/cadastro` + usuario);
  };

  return (
    <MantineProvider>
      <Box>
        <Card shadow={"1rem"} withBorder padding={"1rem"}>
          <TextInput></TextInput>
          <div className="password">
          <TextInput type="password" placeholder="Digite a Senha"></TextInput>
          <span>
          <i class = "fa-regular fa-eye"></i>
          </span>
          </div>
          <button onClick={() => autenticar()}>Login</button>
        </Card>
      </Box>
    </MantineProvider>
  );
}

export default Home;
